import React from 'react';

import '../App.css';

{/* About page */}

function About() {
    return (
        <div>
            <header className="App-font">
                Since 2019, we have been providing users and customers the best
                experience.
            </header>
            <p className="App-font">
                Test
            </p>
      </div>
    );
}

export default About;
